from collections import deque


def main():
    r, c, i, j, n = list(map(int, sys.stdin.readline().split()))
    q = deque([(i, j, 0)])
    visited = set([(i, j, 0)])
    colors = 'ABCDEFGHIJKLMNOPQRSTUVWXYZ'
    color = 0
    while q:
        i, j, step = q.popleft()
        if step == n:
            break
        for di, dj in [(0, 1), (1, 0), (0, -1), (-1, 0)]:
            ni, nj = i + di, j + dj
            if 0 <= ni < r and 0 <= nj < c and (ni, nj, step + 1) not in visited:
                visited.add((ni, nj, step + 1))
                q.append((ni, nj, step + 1))
    i, j, step = q.pop()
    print('\n'.join(''.join('.') * c for _ in range(r)))
    for di, dj in [(0, 1), (1, 0), (0, -1), (-1, 0)]:
        ni, nj = i + di, j + dj
        if 0 <= ni < r and 0 <= nj < c:
            print(colors[color], end='')
        else:
            print('@', end='')
        color = (color + 1) % 26
    print()

